function getFirmByCategory(node, flaga){
if(flaga){
  ajaxURL  =   '/ajax/search.php?ajax=true&category='+node+'&selectFirm=t&getNameFirm=t'
}else{
  ajaxURL  =   '/ajax/search.php?ajax=true&category='+node+'&selectTrait=y&getNameTrait=t'
}


    
$.getJSON(ajaxURL,function(json){
    
if(!flaga){
json.firm_name = {};
for(i in json['traits[1175153098]']){
    json.firm_name[i] = json.traits_name[i]
}
}    
    
producerArray = [];
alfabeticalArray = [];
alfabeticalTmpArray = [];
j = 0;
literka = '';
for(i in json.firm_name){
  if($.isNumeric(json.firm_name[i].charAt(0))){
    literka = '0-9';
  }else{
    literka = json.firm_name[i].charAt(0).toUpperCase();
  }  
  producerArray[j] = [json.firm_name[i],literka,i];
  j++;
}
producerArray.sort(function (a, b) {
    return a[1].toLowerCase().localeCompare(b[1].toLowerCase());
});

producerArray[producerArray.length] = ["", "@", ""];

j = 0;
currentLetter = producerArray[0][1];
for(i in producerArray){
    if(currentLetter == producerArray[i][1]){
        alfabeticalTmpArray[j] = producerArray[i];
        j++;
    }else{
        alfabeticalArray[currentLetter+""] = alfabeticalTmpArray;
        currentLetter = producerArray[i][1];
        alfabeticalTmpArray = [];
        j=0;
        alfabeticalTmpArray[j] = producerArray[i];
        j++;
    }
}

var indexProducerHTML = '<div id="producer_index">';
indexProducerHTML += '<div class="index_pagination">'; 
for(i in alfabeticalArray){
   indexProducerHTML += '<a href="#section_'+i+'">'+i+'</a>';
}
indexProducerHTML += '</div>'; 

indexProducerHTML += '<div class="index_content">'; 
for(i in alfabeticalArray){
 indexProducerHTML += '<div class="producer_index_wrapper">'
   indexProducerHTML += '<h2 id="section_'+i+'">'+i+'</h2>';
   indexProducerHTML += '<div class="producer_index_sub">';
   licznikTmp = 1;
   
   alfabeticalArray[i] = alfabeticalArray[i].sort();
   
   for(j in alfabeticalArray[i]){
    
    indexProducerHTML += '<a href="/search.php?';
    if(!flaga){
        indexProducerHTML += 'traits[1175153098]='+alfabeticalArray[i][j][2];
    }else{
        indexProducerHTML += 'firm='+alfabeticalArray[i][j][2];
    }
    
    if(node){
         indexProducerHTML += '&node='+node;
    }
    indexProducerHTML += '">'+alfabeticalArray[i][j][0]+'</a>';
    
    if(!(licznikTmp % 3)){
        indexProducerHTML += '<div style="clear:both;"></div>'
    }
    licznikTmp++;
   }
   indexProducerHTML += '</div>'
   indexProducerHTML += '</div>'
}
indexProducerHTML += '</div>'; 
indexProducerHTML += '</div>'; 
$('#middle_sub div.middle_bottom').before(indexProducerHTML);

})


}



